(114, '53cef258b5fe536c2174633bcbc1baaf', 4, 'Grafite\\Cms\\Models\\Page', '{\"id\":4,\"title\":\"Our Story\",\"url\":\"our-story\",\"entry\":null,\"seo_description\":null,\"seo_keywords\":null,\"is_published\":true,\"template\":\"show\",\"published_at\":\"2018-09-07 04:07:00\",\"blocks\":\"{\\\"nfa-our-story\\\":\\\"<div>[nfa-block id=\\\\\\\"nfa-ourstory\\\\\\\" title=\\\\\\\"Our Story\\\\\\\" desc=\\\\\\\"naisA Global was founded in April 2013 and received its 501c3 non-profit status in November 2014 by Dr. Jamie Younghee Sheen with a vision to build the next generation of great Asian leaders. naisA Global is led by a team of accomplished professionals who have recognized the disproportion between high achieving Asian Americans, and their present lack of representation in leadership roles within large corporations, universities, and government. Often referred to as the \\\\u201cbamboo ceiling\\\\u201d or \\\\u201csticky floor,\\\\u201d this is largely cited as a result of a combination of individual, cultural, and organizational factors impeding Asian professionals from career progress. naisA Global\\\\u2019s goal is to educate and empower emerging young Asian leaders across the world by providing them with mentorship opportunities, leadership training, and tools that foster and develop effective communication skills. Our programs were established in response to the critical lack of Asian leadership that exists nationally and globally.\\\\\\\"] [nfa-block id=\\\\\\\"nfa-addressing\\\\\\\" title=\\\\\\\"Addressing the Global Challenge\\\\\\\" desc=\\\\\\\"The International Monetary Fund estimates that by 2030, Asia\\\\u2019s share of the world GDP will reach more than 40%. This means that businesses will need high caliber Asian leadership to drive their growth. People who possess the necessary skills, behavior and personality critical to great leadership are paramount to a thriving economy. The challenge facing this global market is a serious shortage within the Asian leadership pool.\\\\\\\" image=\\\\\\\"Photo-for-our-story-155x77.jpg\\\\\\\"] [nfa-block id=\\\\\\\"nfa-titleandcontent\\\\\\\" title=\\\\\\\"Leading in Achievement yet Lacking in Leadership\\\\\\\" desc=\\\\\\\"Asian students consistently demonstrate outstanding academic achievement, and a high rate of Asian graduates continue to earn advanced degrees and land careers at some of the best companies around the world. In fact, 25% of Ivy League students are Asian, and Asians represent 50% of the workforce in Silicon Valley, the hub of the US Tech Industry. Despite these accomplishments, the number of Asians occupying leadership positions in America is disproportionately low, with only\\\\\\\"]<\\\\\\/div><div><br><\\\\\\/div><div>&lt;ul&gt;<\\\\\\/div><div>2% of Fortune 500 CEOs<\\\\\\/div><div>2% of college presidents<\\\\\\/div><div>Less than 1% of board members<\\\\\\/div><div>Around 0.3% of corporate officers<\\\\\\/div><div>On a global scale, the rate of Asians in significant leadership roles is even lower.<\\\\\\/div><div>&lt;\\\\\\/ul&gt;<\\\\\\/div><div><br><\\\\\\/div><div>[nfa-block id=\\\\\\\"nfa-titleandcontent\\\\\\\" title=\\\\\\\"Transforming the Landscape\\\\\\\" desc=\\\\\\\"We aim to address these challenges by providing a global platform to both aspiring and established Asian leaders from across the world and various industries, to learn, develop and contribute. Through our premier educational programs and services such as our flagship Mentor-Prot\\\\u00e9g\\\\u00e9 Program and other strategic initiatives, we are dedicated to not only raise awareness of the leadership talents issues facing the global Asian community, but also help young, talented Asian professionals overcome professional barriers so they can take charge of their careers within various industries, to learn, develop and contribute.\\\\\\\"] [nfa-block id=\\\\\\\"nfa-titleandcontent\\\\\\\" title=\\\\\\\"Our Mission\\\\\\\" desc=\\\\\\\"naisA Global is a 501(c)(3) non-profit educational organization dedicated to helping talented young Asian professionals unlock their potential and become great leaders. It is the only non-profit of its kind to provide a global platform to educate, develop, inspire and positively impact careers of emerging Asian leaders around the world and across various industries \\\\u2013 business, technology, law, medicine, arts, science, politics and non-profits.\\\\\\\"]<\\\\\\/div><div><br><\\\\\\/div><div><br><\\\\\\/div><div>Our goals:<\\\\\\/div><div>&lt;ul&gt;<\\\\\\/div><div>Educate young Asian professionals to take the lead in their careers<\\\\\\/div><div>Prepare young Asian professionals for global leadership roles through our premier mentoring programs<\\\\\\/div><div>Help raise an awareness of the business challenges members of the Asian community face and learn strategies for overcoming them<\\\\\\/div><div>Train young Asian professionals around the world in the art of effective English communication and team building<\\\\\\/div><div>Provide both established and young Asian professionals a global platform to share stories and address unique challenges associated with leadership roles<\\\\\\/div><div>&lt;\\\\\\/ul&gt;<\\\\\\/div><div>[nfa-block id=\\\\\\\"nfa-subscribe\\\\\\\"]<\\\\\\/div><div><br><\\\\\\/div>\\\"}\",\"hero_image\":null}', '2018-09-07 03:55:53', '2018-09-07 03:55:53'),
