tage within the Asian leadership pool.\\\\\\\" image=\\\\\\\"Photo-for-our-story-155x77.jpg\\\\\\\"] [nfa-block id=\\\\\\\"nfa-titleandcontent\\\\\\\" title=\\\\\\\"Leading in Achievement yet Lacking in Leadership\\\\\\\" desc=\\\\\\\"Asian students consistently demonstrate outstanding academic achievement, and a high rate of Asian graduates continue to earn advanced degrees and land careers at some of the best companies around the world. In fact, 25% of Ivy League students are Asian, and Asians represent 50% of the workforce in Silicon Valley, the hub of the US Tech Industry. Despite these accomplishments, the number of Asians occupying leadership positions in America is disproportionately low, with only\\\\\\\"]<\\\\\\/div><div><br><\\\\\\/div><div>&lt;ul&gt;<\\\\\\/div><div>2% of Fortune 500 CEOs<\\\\\\/div><div>2% of college presidents<\\\\\\/div><div>Less than 1% of board members<\\\\\\/div><div>Around 0.3% of corporate officers<\\\\\\/div><div>On a global scale, the rate of Asians in significant leadership roles is even lower.<\\\\\\/div><div>&lt;\\\\\\/ul&gt;<\\\\\\/div><div><br><\\\\\\/div><div>[nfa-block id=\\\\\\\"nfa-titleandcontent\\\\\\\" title=\\\\\\\"Transforming the Landscape\\\\\\\" desc=\\\\\\\"We aim to address these challenges by providing a global platform to both aspiring and established Asian leaders from across the world and various industries, to learn, develop and contribute. Through our premier educational programs and services such as our flagship Mentor-Prot\\\\u00e9g\\\\u00e9 Program and other strategic initiatives, we are dedicated to not only raise awareness of the leadership talents issues facing the global Asian community, but also help young, talented Asian professionals overcome professional barriers so they can take charge of their careers within various industries, to learn, develop and contribute.\\\\\\\"] [nfa-block id=\\\\\\\"nfa-titleandcontent\\\\\\\" title=\\\\\\\"Our Mission\\\\\\\" desc=\\\\\\\"naisA Global is a 501(c)(3) non-profit educational organization dedicated to helping talented young Asian professionals unlock their potential and become great leaders. It is the only non-profit of its kind to provide a global platform to educate, develop, inspire and positively impact careers of emerging Asian leaders around the world and across various industries \\\\u2013 business, technology, law, medicine, arts, science, politics and non-profits.\\\\\\\"]<\\\\\\/div><div><br><\\\\\\/div><div><br><\\\\\\/div><div>Our goals:<\\\\\\/div><div>&lt;ul&gt;<\\\\\\/div><div>Educate young Asian professionals to take the lead in their careers<\\\\\\/div><div>Prepare young Asian professionals for global leadership roles through our premier mentoring programs<\\\\\\/div><div>Help raise an awareness of the business challenges members of the Asian community face and learn strategies for overcoming them<\\\\\\/div><div>Train young Asian professionals around the world in the art of effective English communication and team building<\\\\\\/div><div>Provide both established and young Asian professionals a global platform to share stories and address unique challenges associated with leadership roles<\\\\\\/div><div>&lt;\\\\\\/ul&gt;<\\\\\\/div><div>[nfa-block id=\\\\\\\"nfa-subscribe\\\\\\\"]<\\\\\\/div><div><br><\\\\\\/div>\\\",\\\"overview\\\":\\\"\\\"}\",\"hero_image\":null}', '2018-09-07 03:57:20', '2018-09-07 03:57:20');
