\/\\/naisaglobal.org\\/staging\\/wp-content\\/uploads\\/2018\\/08\\/cindy-shao-180x180.jpg\\\" class=\\\"attachment-large size-large wp-post-image\\\" alt=\\\"\\\" srcset=\\\"https:\\/\\/naisaglobal.org\\/staging\\/wp-content\\/uploads\\/2018\\/08\\/cindy-shao-180x180.jpg 180w, https:\\/\\/naisaglobal.org\\/staging\\/wp-content\\/uploads\\/2018\\/08\\/cindy-shao-60x60.jpg 60w, https:\\/\\/naisaglobal.org\\/staging\\/wp-content\\/uploads\\/2018\\/08\\/cindy-shao-118x118.jpg 118w, https:\\/\\/naisaglobal.org\\/staging\\/wp-content\\/uploads\\/2018\\/08\\/cindy-shao-160x160.jpg 160w, https:\\/\\/naisaglobal.org\\/staging\\/wp-content\\/uploads\\/2018\\/08\\/cindy-shao.jpg 400w, https:\\/\\/naisaglobal.org\\/staging\\/wp-content\\/uploads\\/2018\\/08\\/cindy-shao-300x300.jpg 300w, https:\\/\\/naisaglobal.org\\/staging\\/wp-content\\/uploads\\/2018\\/08\\/cindy-shao-100x100.jpg 100w\\\" sizes=\\\"(max-width: 180px) 100vw, 180px\\\"><\\/div>\\r\\n                                                                <div class=\\\"text testimonial_rotator_description\\\">\\r\\n                                                                    <h2 class=\\\"testimonial_rotator_slide_title\\\">Mentor Cindy Shao<\\/h2>\\r\\n                                                                    <div class=\\\"testimonial_rotator_quote\\\">\\r\\n                                                                        I would like to applaud for naisA\'s work building a great platform and bringing together inspiring mentors and aspiring Asian American young professionals. It opens doors for many relationship building and career advancement opportunities for our next generation leaders. Kudos to your tireless efforts!<\\/div>\\r\\n                                                                    <div class=\\\"testimonial_rotator_author_info cf-tr\\\">\\r\\n                                                                        <p>President<\\/p>\\r\\n                                   