1759031\\\" frameborder=\\\"0\\\" allowfullscreen=\\\"allowfullscreen\\\"><\\/iframe><\\/p>\\r\\n\\t\\t\\t\\t\\t\\t\\t<\\/div> <!-- .entry-content -->\\r\\n\\t\\t\\t\\t\\t\\t<\\/article>\\r\\n\\t\\t\\t\\t\\t<\\/div>\",\"seo_description\":null,\"seo_keywords\":null,\"is_published\":true,\"template\":\"nfa-annual-reports-template\",\"published_at\":\"2018-09-07 12:54:00\",\"blocks\":\"{\\\"overview\\\":null}\",\"hero_image\":null}', '2018-09-07 07:27:40', '2018-09-07 07:27:40'),
(150, '75d7758a1cbe6ed864a63cdc4d31488e', 4, 'Grafite\\Cms\\Models\\Blog', '{\"id\":4,\"title\":\"Challenging &amp;ldquo;Model Minority&amp;rdquo; Stereotypes\",\"entry\":\"<div class=\\\"entry-content\\\">\\r\\n\\t\\t\\t\\t\\t<p>If you have not yet had the chance to check out the <a href=\\\"http:\\/\\/www.wearenotthesame.org\\/\\\">#NotTheSame campaign<\\/a> among social media outlets, you should. Initiated by the Asian and Pacific Islander American Scholarship Fund (APIASF), this campaign aims to challenge and undermine the <a href=\\\"https:\\/\\/naisaglobal.org\\/staging\\/blog\\/perceived-barriers-to-the-top-for-asian-americans-2\\/\\\">\\u201cmodel minority\\u201d stereotypes of Asian American Pacific Islanders<\\/a> (AAPI) as successful individuals expected to reach prestigious heights in academia and in their careers, a myth that in turn relies on stereotypes about Asian cultures.<\\/p>\\r\\n<p>The reality is that Asian American youth face systemic barriers in society due to a wide range of stereotypes. These stereotypes, often faced while navigating through academia and workforce, might differ in many ways from other minority stereotypes. It either ignores or romanticizes the perceived differences that separate them from the white plurality population in the United States. On the surface, the \\u201cmodel minority\\u201d stereotype appear to favor the AAPI community. However, this notion omits those who may be struggling with unemployment, poverty, homelessness, or similarly troublesome situations that a doctorate degree or a board membership cannot easily eradicate.<\\/p>\\r\\n<p>The #NotTheSame campaign is one of several ways in which AAPI youth are taking to social media to inform and educate others about the ways in which issues of race impact them negatively. It brings to light the social issues faced by the AAPI community along with the myth that all AAPI are prosperous and advantaged when it comes to education and the workforce.<\\/p>\\r\\n<p>Despite the struggles and woes the AAPI community face as they navigate through a society that assigns them to certain prejudices and stereotypes, the <a href=\\\"http:\\/\\/www.nbcnews.com\\/news\\/asian-america\\/notthesame-campaign-aims-challenge-asian-american-stereotypes-n467561\\\">campaign inspires and motivates the AAPI community<\\/a> to rise above the complex conflict between the \\u201cmodel minority\\u201d stereotypes and the reality of racial discrimination in order to thrive.<\\/p>\\r\\n<p><strong><i>naisA Global is a 501(c)(3) non-profit educational organization dedicated to helping talented young Asian professionals unlock their potential and become great leaders.<\\/i><\\/strong><\\/p>\\r\\n\\t\\t\\t\\t\\t<\\/div>\",\"tags\":\"naisA Global\",\"is_published\":true,\"seo_description\":null,\"seo_keywords\":null,\"url\":\"challenging-model-minority-stereotypes\",\"template\":\"show\",\"published_at\":\"2018-09-07 07:34:00\",\"blocks\":\"{}\",\"hero_image\":\"public\\/images\\/2743671ed388f755416d6ec2ae5ecbe8.jpg\"}', '2018-09-07 08:19:03', '2018-09-07 08:19:03'),
(151, '35bcef683430267d57b9df8bc122e03c', 4, 'Grafite\\Cms\\Models\\Blog', '{\"id\":4,\"title\":\"Challenging &amp;amp;ldquo;Model Minority&amp;amp;rdquo; Stereotypes\",\"entry\":\"<div class=\\\"entry-content\\\">\\r\\n\\t\\t\\t\\t\\t<p>If you have not yet had the chance to check out the <a href=\\\"http:\\/\\/www.wearenotthesame.org\\/\\\">#NotTheSame campaign<\\/a> among social media outlets, you should. Initiated by the Asian and Pacific Islander American Scholarship Fund (APIASF), this campaign aims to challenge and undermine the <a href=\\\"https:\\/\\/naisaglobal.org\\/staging\\/blog\\/perceived-barriers-to-the-top-for-asian-americans-2\\/\\\">\\u201cmodel minority\\u201d stereotypes of Asian American Pacific Islanders<\\/a> (AAPI) as successful individuals expected to reach prestigious heights in academia and in their careers, a myth that in turn relies on stereotypes about Asian cultures.<\\/p>\\r\\n<p>The reality is that Asian American youth face systemic barriers in society due to a wide range of stereotypes. These stereotypes, often faced while navigating through academia and workforce, might differ in many ways from other minority stereotypes. It either ignores or romanticizes the perceived differences that separate them from the white plurality population in the United States. On the surface, the \\u201cmodel minority\\u201d stereotype appear to favor the AAPI community. However, this notion omits those who may be struggling with unemployment, poverty, homelessness, or similarly troublesome situations that a doctorate degree or a board membership cannot easily eradicate.<\\/p>\\r\\n<p>The #NotTheSame campaign is one of several ways in which AAPI youth are taking to social media to inform and educate others about the ways in which issues of race impact them negatively. It brings to light the social issues faced by the AAPI community along with the myth that all AAPI are prosperous and advantaged when it comes to education and the workforce.<\\/p>\\r\\n<p>Despite the struggles and woes the AAPI community face as they navigate through a society that assigns them to certain prejudices and stereotypes, the <a href=\\\"http:\\/\\/www.nbcnews.com\\/news\\/asian-america\\/notthesame-campaign-aims-challenge-asian-american-stereotypes-n467561\\\">campaign inspires and motivates the AAPI community<\\/a> to rise above the complex conflict between the \\u201cmodel minority\\u201d stereotypes and the reality of racial discrimination in order to thrive.<\\/p>\\r\\n<p><strong><i>naisA Global is a 501(c)(3) non-profit educational organization dedicated to helping talented young Asian professionals unlock their potential and become great leaders.<\\/i><\\/strong><\\/p>\\r\\n\\t\\t\\t\\t\\t<\\/div>\",\"tags\":\"naisA Global\",\"is_published\":true,\"seo_description\":null,\"seo_keywords\":null,\"url\":\"challenging-model-minority-stereotypes\",\"template\":\"show\",\"published_at\":\"2018-09-07 07:34:00\",\"blocks\":\"{}\",\"hero_image\":\"public\\/images\\/aad36ae89652fe4095111ce0964abf56.jpg\"}', '2018-09-07 08:20:13', '2018-09-07 08:20:13'),
