(2, 'Fastest Growing Minority Group&amp;amp;rsquo;s Utilization of Social Media', '<div class=\"entry-content\">\r\n					<p>The <a href=\"http://www.pewsocialtrends.org/asianamericans/\">racial and ethnic makeup</a> of the United States is changing rapidly and Asians are the <a href=\"http://www.nielsen.com/us/en/insights/news/2015/meet-the-fastest-growing-multicultural-segment-in-the-us-asian-americans.html\">fastest-growing minority population in the United States</a>. As a result, there is an increased representation of Asians in different United States job industries and sectors; about 50% of the Silicon Valley tech industry is Asian.</p>\r\n<p>Although Asians are the leading minority group in the tech industry, there is an underwhelming amount of Asians in executive positions, a phenomenon known as the sticky floor or bamboo ceiling. Only 13% of the tech sector has Asian executives and overall less than 2% of Fortune 500 companies have Asian leadership. Despite the lack of representation, this community proves themselves as capable of fueling the transformation of different industries by taking to social media and discovering new and innovative ways of consuming technology.</p>\r\n<p>According to Facebook IQ, average weekly usage of social media is highest among Asian-Americans. Many of them are <a href=\"http://insights.fb.com/2015/03/05/closer-look-asian-americans-us/\">using social media to access cultural content</a> that is not available on other media platforms to connect with their roots. There is better access to language-learning opportunities and information on music and literature of the foreign culture. However, social media has been a platform to address social issues associated with Asian-Americans such as overcoming barriers and obstacles for career advancement and  <a href=\"https://naisaglobal.org/staging/blog/challenging-model-minority-stereotypes/\">model minority stereotypes</a> which we have addressed last week.</p>\r\n<p>The evolution of both the demographics of the United States and the diversity of social media outlets is full of potential. It is promising to businesses and organizations that are hoping to reach out to a rapidly changing population. Social media has presented Asian-Americans with an opportunity to make their voice heard and to educate others throughout the United States and the world about a variety of issues tied to race and ethnicity in the United States. At naisA Global, we hope to raise continuous awareness to a variety of issues brought to the Asian community.</p>\r\n<p><strong><i>naisA Global is a 501(c)(3) non-profit educational organization dedicated to helping talented young Asian professionals unlock their potential and become great leaders.</i></strong></p>\r\n					</div>', 'naisA Global', 1, NULL, NULL, 'fastest-growing-minority-groups-utilization-of-social-media', '2018-09-07 02:00:35', '2018-09-07 02:01:21', 'show', '2018-09-07 07:30:00', '{}', 'public/images/1a6118c0614cc344ca2e132b93e56bb4.jpg'),
(3, 'Latest Trends in Workplace Diversity', '<div>&lt;div class=\"entry-content\"&gt;\r\n</div>\r\n<div>&lt;p&gt;As recently as last year, a survey of corporate leaders showed workplace diversity wasnt a priority. However, changes have happened quickly, and there are now a record number of corporations either starting diversity programs from the ground up, or tweaking the ones they have. Diversity has been a word tossed around in corporate culture for a while, but leaders are finally making their actions match their words. Keep reading to get the details.&lt;/p&gt;\r\n</div>\r\n<div>&lt;p&gt;&lt;b&gt;Starbucks Employees No Longer Have to Hide Tattoos &lt;/b&gt;&lt;/p&gt;\r\n</div>\r\n<div>&lt;p&gt;Many people use tattoos as a way to display their individuality. However, up until last fall, Starbucks customer-facing employees had to keep their tattoos concealed under clothing. Now, tattoos can stay on full display unless theyre on a workers face. When a corporate giant like Starbucks recognizes that body art allows people to show their unique style and doesnt impact the quality of customer service, thats a big endorsement of greater diversity.&lt;/p&gt;\r\n</div>\r\n<div>&lt;p&gt;&lt;b&gt;CEOs Are Speaking Out to Support Diversity &lt;/b&gt;&lt;/p&gt;\r\n</div>\r\n<div>&lt;p&gt;In the past, company leaders have kept their lips zipped about their stances on diversity. However, the CEOs from Lockheed Martin and Intel are two people who have eagerly piped up about their desire for more diverse workplaces. Some have discussed diversity initiatives at keynote speeches, and others have spent multi-million dollar budgets to hire more women and minority groups for specialty industries such as engineering.&lt;/p&gt;\r\n</div>\r\n<div>&lt;p&gt;&lt;b&gt;Diversitys Definition is Widening, Too&lt;/b&gt;&lt;/p&gt;\r\n</div>\r\n<div>&lt;p&gt;Less than a decade ago, the word diversity had a relatively basic and ambiguous definition. Now, however, diversity initiatives are becoming much more specific and appealing. Some companies are even extending the definition to mean diversity in terms of thinking outside the box and being especially good at a particular skill, such as solving problems.&lt;/p&gt;\r\n</div>\r\n<div>&lt;p&gt;&lt;b&gt;More Transparency About a Lack of Diversity&lt;/b&gt;&lt;/p&gt;\r\n</div>\r\n<div>&lt;p&gt;Companies have also been more upfront about disclosing whether their employee makeup has a dearth of diversity. Thats a move in the right direction. After all, as the common line of thought goes, the first step to fixing a problem is knowing it exists.&lt;/p&gt;\r\n</div>\r\n<div>&lt;p&gt;Tim Cook, CEO of Apple Corporation, recently got people talking by discussing discrimination in the workplace. He raised awareness that theres still a long way to go in making workplaces more diverse, but just the fact that he brought attention to the matter was seen as a major accomplishment in the business world.&lt;/p&gt;\r\n</div>\r\n<div>&lt;p&gt;&lt;strong&gt;&lt;em&gt;naisA Global is a 501(c)(3) non-profit educational organization dedicated to helping talented young Asian professionals unlock their potential and become great leaders.&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\r\n</div>\r\n<div>&lt;/div&gt;\r\n</div>', 'Jamie Younghee Sheen', 1, NULL, NULL, 'latest-trends-in-workplace-diversity', '2018-09-07 02:03:35', '2018-09-07 02:03:35', 'show', '2018-09-07 07:33:35', '{}', 'public/images/5b788a6ca51f991d1921ec3841df2f8a.jpg'),
(4, 'Challenging &amp;amp;ldquo;Model Minority&amp;amp;rdquo; Stereotypes', '<div class=\"entry-content\">\r\n					<p>If you have not yet had the chance to check out the <a href=\"http://www.wearenotthesame.org/\">#NotTheSame campaign</a> among social media outlets, you should. Initiated by the Asian and Pacific Islander American Scholarship Fund (APIASF), this campaign aims to challenge and undermine the <a href=\"https://naisaglobal.org/staging/blog/perceived-barriers-to-the-top-for-asian-americans-2/\">model minority stereotypes of Asian American Pacific Islanders</a> (AAPI) as successful individuals expected to reach prestigious heights in academia and in their careers, a myth that in turn relies on stereotypes about Asian cultures.</p>\r\n<p>The reality is that Asian American youth face systemic barriers in society due to a wide range of stereotypes. These stereotypes, often faced while navigating through academia and workforce, might differ in many ways from other minority stereotypes. It either ignores or romanticizes the perceived differences that separate them from the white plurality population in the United States. On the surface, the model minority stereotype appear to favor the AAPI community. However, this notion omits those who may be struggling with unemployment, poverty, homelessness, or similarly troublesome situations that a doctorate degree or a board membership cannot easily eradicate.</p>\r\n<p>The #NotTheSame campaign is one of several ways in which AAPI youth are taking to social media to inform and educate others about the ways in which issues of race impact them negatively. It brings to light the social issues faced by the AAPI community along with the myth that all AAPI are prosperous and advantaged when it comes to education and the workforce.</p>\r\n<p>Despite the struggles and woes the AAPI community face as they navigate through a society that assigns them to certain prejudices and stereotypes, the <a href=\"http://www.nbcnews.com/news/asian-america/notthesame-campaign-aims-challenge-asian-american-stereotypes-n467561\">campaign inspires and motivates the AAPI community</a> to rise above the complex conflict between the model minority stereotypes and the reality of racial discrimination in order to thrive.</p>\r\n<p><strong><i>naisA Global is a 501(c)(3) non-profit educational organization dedicated to helping talented young Asian professionals unlock their potential and become great leaders.</i></strong></p>\r\n					</div>', 'naisA Global', 1, NULL, NULL, 'challenging-model-minority-stereotypes', '2018-09-07 02:04:49', '2018-09-07 08:20:13', 'show', '2018-09-07 07:34:00', '{}', 'public/images/aad36ae89652fe4095111ce0964abf56.jpg'),
(5, 'Female Asian Leadership and Asian Leadership in the West', '<div class=\"entry-content\">\r\n					<p>Rapid economic growth in Asia is creating more opportunities for women, yet they are still underrepresented in senior roles. Similar to the deficit of Asian leaders in the West, women are twice as least likely to be in senior roles such as CFO or CEO. <a href=\"http://www.organisationsolutions.com/Resources/Leadership-Assessment/Creating-Our-Own-Glass-Ceiling\">The pattern is constant across business despite an increase in qualified women in recent years.</a> Again, this can be considered against a pattern in the US where there is a clear disproportion between the potential of higher performing Asian Americans in academia and entrepreneurship, and their representation in roles of leadership within large corporations, universities, and government.</p>\r\n<p>The benefits of having more women in senior roles is linked to stronger financial performance, and &nbsp;women leaders work in different ways from men and can bring real competitive advantage to their field. Likewise, 20 percent of the students in Ivy League schools are of Asian decent, and with more than 50 percent of the workforce of Silicon Valley, there is clearly a vast pool of talent waiting to be tapped and cultivated for leading biggest businesses to a healthy future. Women need vastly larger representation in leading roles in Asia, and Asians of both genders need greater opportunity to lead in the West.</p>\r\n<p><a href=\"http://www.cimaglobal.com/Documents/Thought_leadership_docs/Women%20in%20leadership/Reflectionsasiapacificleaders.pdf\">In a report by Chartered Institute of Management Accountants (CIMA)</a>, individual strategies for success include getting <a href=\"https://naisaglobal.org/staging/blog/the-importance-of-mentorship/\">support from a mentor</a>, promoting your achievements and joining female networks. There are interesting parallels here regarding women in the highest positions in Asia and both male and female Asian professionals in similarly senior roles in the West.</p>\r\n<p>naisA Global was created to support young Asian professionals globally, both male and female, and their growth and progression to the highest positions in their industry. We have a number of specific programs and resources to help our members achieve this. For example, our <a href=\"https://naisaglobal.org/staging/flashadvice/\">naisA Flash Advice (nFA) mentoring program</a> is designed to help our members overcome many of the barriers they typically face. Our experts help with planning career paths, developing the right experience, seek out new opportunities, understanding ones business from a senior management perspective, and developing confidence, self-belief, and motivation, among other valuable assistance. naisAs online platform is a place where our mentors and protgs keep up on whats going on in the Asian business world and beyond, where we share professional and leadership advice and information on how to promote themselves and their achievements.</p>\r\n<p>Most leading figures in Asia want to increase the number of Asian leaders in their companies highest positions, but there is a concern about a lack of available Asian leadership talent. <a href=\"http://www.organisationsolutions.com/Resources/Leadership-Assessment/Breaking-the-Asian-Leadership-Ceiling\">Yet, businesses and industry across the continent, in Japan, China, Korea, and India, often have large numbers of Asian senior staff</a>. Young Asian talent is very much on the rise, and its not a case of if for young professionals taking leadership roles, but when.</p>\r\n<p>Our protgs are the most talented young Asian professionals based in America, across Asia and the rest of the world. They are male and female, and each have their own specific goals and plans for success. With naisAs help they are determined to be the next generation of great leaders.</p>\r\n					</div>', 'Jamie Younghee Sheen', 1, NULL, NULL, 'female-asian-leadership-and-asian-leadership-in-the-west', '2018-09-07 02:06:11', '2018-09-07 02:06:11', 'show', '2018-09-07 07:36:11', '{}', 'public/images/0cab742e3f31cb94345e27297f333fd6.jpg'),
(6, 'The New Resume: Micro-resume', '<div class=\"entry-content\">\r\n					<p>As recent graduates and young professionals are on their job hunt, they are trying to build their credibility as we spoke about in our August post of &nbsp;<a href=\"https://naisaglobal.org/staging/blog/gaining-credibility-as-a-young-professional/\">Gaining Credibility as a Young Professional</a>.</p>\r\n<p>They are also meticulously perfecting their resume. In this day and age, what job applicant does not have a resume? There are various ways to have your resume stand out above everyone else. Some say &nbsp;the more you have written on your resume the better. Others say its the quality, not the quantity of your work experience.</p>\r\n<p>Whichever method one follows, a resume is necessary for job applicants and thanks to social media the way we are applying for jobs is changing. The advent of social media over the past decade has rapidly changed job search processes. LinkedIn, for example, has been a commonly used channel: employers can notify their networks of new opportunities and job seekers can showcase their background and interests. These changes come with uncharted territory for professionals connecting internationally.</p>\r\n<p>What has been on the rise for the past few years among Chinese professionals is the <a href=\"http://www.wsj.com/articles/SB10000872396390444226904577561643928840040\">micro-resume</a>, which can be thought of as a tweet-sized about section in a social media users profile that concisely summarizes ones professional background and interests. This practice makes the American one-page resume look like information overload. While the micro-resume has caught the attention of some American employers, it still has a long way to go before putting the verbose one-page resume out of use. &nbsp;The closest that LinkedIn users in the US has come to a micro-resume might be the &nbsp;professional headline sectionwhich many LinkedIn users fill in with a job title and employer.</p>\r\n<p>Resumes place disproportionately greater emphasis on ones past achievements, often quantified, over ones future career goals, which, if anything, would be outlined in a relatively short objective statement or executive summary. The concept of the micro-resume forcibly limits room for detailing past professional achievements, but at the same time does not eliminate the need to describe, albeit concisely, &nbsp;ones future career objectives. The effects of this need for severe brevity could better help job seekers either aiming for a career switch or for the simple development of work experience.<br>\r\nWhile it is popular in Chinese social media networks, how quickly the idea of the micro-resume can spread in the US still has yet to be seen because how Chinese social media networks operate differs sharply from the US. It does appear a promising idea for employers and job seekers in a world that is becoming more interconnected and broadcasting job searches increasingly on Twitter, Facebook, and/or Tumblr accounts.</p>\r\n<p><i>naisA Global is a 501(c)(3) non-profit educational organization dedicated to helping talented young Asian professionals unlock their potential and become great leaders.</i></p>\r\n					</div>', 'naisA Global', 1, NULL, NULL, 'the-new-resume-microresume', '2018-09-07 02:08:50', '2018-09-07 02:08:50', 'show', '2018-09-07 07:38:50', '{}', 'public/images/294a402f926c6cdecd44e4009d139000.png'),
(7, 'Diversity: Stepping Up to the Challenge', '<div class=\"entry-content\">\r\n					<p>This week, we take a step back from leadership to look at diversity in the workplace. According to the US Bureau of Labor Statistics, the total number employed in 2014 was over 146 million. However, not all 146 million workers in the US are going to be exactly the same. The difference between each employee is what makes a workplace diverse.</p>\r\n<p>The case for diversity has never been stronger, nor more widely accepted. In the workplace, diverse workforces are more innovative and, generally, more profitable. The sheer number and variety of efforts to achieve it are also at an all-time high. No serious observer thinks that these efforts will, or should, slow down, but how are we reaching the goal and how are we measuring it to indicate real success?</p>\r\n<p>First, wed have to answer, what does diversity mean? To put it simply, diversity is the ability to live and work with people who differ from us, according to David Berreby in his article Why Old Habits Die Hard. However, diversity across time has been as variable as it is across territories.</p>\r\n<p>Women were not included in many first-generation diversity efforts, which focused on racial and religious identities. And efforts to include gay people in diversity efforts, now standard in many parts of North America and Western Europe, were almost unheard of until recently. The same could be said about efforts to include people with disabilities. Sometimes it seems that just as your diversity materials catch up with the latest cultural change, a new one appears on the horizon.</p>\r\n<p>Diversity is a moving target; it cannot be reduced to specific measures aimed at specific groups of people. What works in one place will fail in another; what is cutting edge in one time may be inadequate a decade later. As diversity increases, social capital decreases. Yet, one lesson of diversity is that the comfort of social capital is not the best thing for an organization.</p>\r\n<p>As the conscious mind accepts the value of diversity, the unconscious mind tries to protect its social capital, quite outside of our awareness. Much of the behavior that forestalls diversity is entirely unconscious. In our minds, dealing with those who are like us  who understand what we mean without needing much explanation, who share experiences and an outlook  feels comfortable and reassuring. It is not consciously hostile to those who arent at the table, but it has the same effect. The biases that keep us from including new kinds of people exert their effects outside of our field of awareness.</p>\r\n<p>The process of diversity requires flexibility, openness to change, self-awareness and self-discipline. True diversity, which lets an organization welcome all talent and thus benefit from inclusion, is a state of mind. We hope that our young readers will make a conscious effort to fight our unconscious to promote diversity.</p>\r\n<p><b><i>naisA Global is a 501(c)(3) non-profit educational organization dedicated to helping talented young Asian professionals unlock their potential and become great leaders.</i></b></p>\r\n					</div>', 'naisA Global', 1, NULL, NULL, 'diversity-stepping-up-to-the-challenge', '2018-09-07 02:14:57', '2018-09-07 02:14:57', 'show', '2018-09-07 07:44:56', '{}', 'public/images/05eeb2533a767def093f9c7ba080b3ca.jpg'),
(8, 'Struggling to Reach the Top', '<div class=\"entry-content\">\r\n					<p>Are you a young millennial getting ready to start in the workforce? Are you already there and struggling to rise to the top? Asians face many problems when climbing the business ladder of success. Why is this so? Asian millennials are just as competent as their white counterparts, but they are not represented in the leadership of many businesses and companies, especially in the tech world. This is what we call the bamboo ceiling.</p>\r\n<p>Did you know Asian Americans make up 50% of the tech industry? On one hand, this is great  Asians are heavily represented in the tech world. On the other hand, we arent seeing these Asians in leadership roles. Only 11% of startup senior executives, 6% of which are CEOs, 10% of venture partners, and 8.3% of board members are Asian. Its worse on the east coast where the numbers are much lower.</p>\r\n<p>There is a widespread belief that Asians arent as social as their non-Asian counterparts. They arent built to be leaders. A member of naisA Globals Board of Directors, Tim Hwang, discusses in his article, Asian Americans and the Silicon Railroad, some of the discrimination he experienced as an Asian American entrepreneur in the tech industry.</p>\r\n<p>Hwang gives an anecdote of how he was invited to an invitation-only get-together of technology investors and entrepreneurs, an opportunity not to be passed up. However, upon attending the meeting, he was brushed off by a venture partner as he was trying to strike a conversation and relay his pitch. Being aware of how the entrepreneurial world works, he asked another friend to approach the same person. The friend had gone off for nearly an hour speaking to the same person about various topics, one of which included the state of his business and how they could get together to discuss the opportunity.</p>\r\n<p>Hwang cant help but feel his being Asian was a huge factor in being brushed off. Experiences like this are quite maddening, and also very discouraging. The stunning reality, as he puts it, is that for young Asian-Americans entering the tech industry, working here and gunning for the management track is often a dead-end job. He admits that his level of self-confidence has been slowly receding as he is constantly fighting to break down larger and larger barriers. If Tim, an experienced advisor and entrepreneur is slowly losing confidence, we can only imagine the effect&nbsp; on a young Asian American entrepreneur just starting out.</p>\r\n<p>Although still in his twenties, Tim Hwang has the knowledge and life experience of how to deal with adversity that some young professionals may encounter throughout their careers. His insightful article, <a href=\"https://medium.com/@timthwang/asian-americans-and-the-silicon-railroad-883fc37cc313\">Asian Americans and the Silicon Railroad</a>, inspires us to continue to push through and make sure that these stereotypes do not limit the possibilities for our next generation of great Asian American leaders as he has been doing. We highly recommend you read it!</p>\r\n<p><em>naisA Global is a 501(c)(3) non-profit educational organization dedicated to helping talented young Asian professionals unlock their potential and become great leaders.</em></p>\r\n					</div>', 'naisA Global', 1, NULL, NULL, 'struggling-to-reach-the-top', '2018-09-07 02:16:46', '2018-09-07 02:16:46', 'show', '2018-09-07 07:46:46', '{}', 'public/images/edd8962f308be7203a530ab2bd134887.jpg'),
(9, 'Venturing Out? What You Need to Know', '<div class=\"entry-content\">\r\n					<p>Leadership, leadership, leadership! Last week, we talked about how crucial it is to be a real leader versus a wannabe leader. Society does make quite the emphasis on being a good leader and having great leadership qualities to pave the way for their followers. With this emphasis on leadership, U.S. universities, specifically business schools, have made it one of their goals to produce graduates with the leadership qualities to be able to climb ladders of success. However, with this focus on leadership, there is something theyre not teaching them, being a successful entrepreneur.</p>\r\n<p>That is what Ken Kuang, a member of naisA Globals Board of Directors, addresses in his recent article<span class=\"Apple-converted-space\">&nbsp;</span>for&nbsp;<em>The Wall Street Journal</em>, Teaching Entrepreneurs to Do More Than Dream.<span class=\"Apple-converted-space\"><br>\r\n</span></p>\r\n<p>University of California, San Diegos Moxie Center for Student Entrepreneurship was backed by Irwin Zahns Moxie Foundation aimed to fund startups by student entrepreneurs. However, after two and a half years, the center had closed at the end of June. The center was giving money out to students with dreams of starting their start-up, but never sought returns on its investment to these startups. As Kuang stated, the center was promoting the entrepreneurial spirit, but it wasnt teaching the students what he believes are the two most basic survival skills for startups  the concept of win-win and forecasting profits and losses.</p>\r\n<p>With no knowledge of either, students are struggling to venture out on their own and create a profitable company. As a mentor, Kuang met with business graduates who have little understanding of overhead expenses involved in running a business nor do they understand how retail pricing works. How can business students venture out on their own with no knowledge of the basics?</p>\r\n<p>Kuang and his peers, San Diegos local American Ceramic Society and the International Microelectronics and Packaging Society, seem to have a solution to help recent graduates. They are launching a mentorship-internship program where recent UCSD graduates will be paired with local companies. The program will donate $1,000 to UCSD to pay the interns one-month stipend. If the host company decides to hire the intern within a year, the company will donate $3,000 to the program and allow other UCSD graduates the same opportunity.</p>\r\n<p>Graduating business school is only the first step in being able to venture out into the business world. The program could be a next step for these fresh out of school students to work for companies that might overlook a recent graduate. With the help of this program, graduates undoubtedly will continue their career with a better understanding of entrepreneurial basics. We highly recommend our naisA Globals young emerging leaders read the <a href=\"https://www.linkedin.com/pulse/teaching-entrepreneurs-do-more-than-dream-ken-kuang?trk=prof-post\">insightful article Teaching Entrepreneurs to Do More Than Dream</a> by Ken Kuang, a successful business owner seasoned senior executive, Amazon Best-Seller, and one of the most admired CEOs in San Diego.</p>\r\n<p><em>naisA Global is a 501(c)(3) non-profit educational organization dedicated to helping talented young Asian professionals unlock their potential and become great leaders.</em></p>\r\n					</div>', 'naisA Global', 1, NULL, NULL, 'venturing-out-what-you-need-to-know', '2018-09-07 02:18:37', '2018-09-07 02:18:37', 'show', '2018-09-07 07:48:37', '{}', 'public/images/fd971e4b8cb94df22b9f92b840e19427.jpg'),
(10, 'Why Be a Leader to Begin With?', '<div class=\"entry-content\">\r\n					<p>Another day, another leadership blog post. Advice on best practices! Tips to get ahead of the competition! Learn ways to stand out! Take the Leadership Test! Are You Leadership Material? Do You Have What It Takes?</p>\r\n<p>But maybe first, its worth asking ourselves if we have taken enough time to ask why we want to become leaders in the first place. Is reaching the top of our field and occupying a leadership role the same thing? Umair Haque, in his article for the <em>Harvard Business Review, </em>argues that leadership is a lost art. He claims that currently there is little real leadership anywhere. Instead, he contends, the competitive pool is full of so-called wannabes. Those who want to be leaders but cannot. Those who want the benefits of leadership, without the price. They want the respect, dignity, and title of leadership without leading people to lives that matter; they want the love leaders earn, act by painful act, without, in return, having the courage, humility, and wisdom to love. This is an interesting and quite emotional way to view things.</p>\r\n<p>More practically, Minda Zetlin from Inc.com warns that if your ambitions for leadership are for the wrong reasons, you wont inspire people the way you must to really achieve success. She is of the opinion that many would-be leaders are in it for the wrong reasons.</p>\r\n<p><strong>Money: </strong></p>\r\n<p>Many of the highest paid positions come with a leadership role. Zetlin says that if all you want is a bigger paycheck, youre on the wrong track  again which sounds ideological. In her pragmatic view, if you spend too much time fretting over why your direct reports arent doing what you want them to do, you wont have time to enjoy the fruits of your labor. She advises: find a role thats well paid without the intense responsibility.</p>\r\n<p><strong>Power: </strong></p>\r\n<p>Zetlin, president of a 1,400-memeber association, says she learned that power is overrated. Power means making the difficult decisions, like having to determine when and which employees are fired or laid off. Leadership means disappointing people on a regular basis.</p>\r\n<p><strong>Prestige:</strong></p>\r\n<p>There are perks to being at the top of the ladder; people tend to be polite to you, your office is probably the biggest, hotel rooms can be pretty nice. But if you are a leader worth your salt, youll spend little time enjoying these fringe benefits and more time worrying about results and bottom lines.</p>\r\n<p>What, then, are the right reasons to become a leader? Again, Umair Haque believes that most of our leaders are wannabes, wanting to be seen as leaders without actually leading us anywhere except into stagnation, decline, fracture, fear, apathy, etc. But he maintains that true leaders do exist. They may not crave the limelight, but their intentions are for truth, worth, nobility and meaning. In a practical sense that means:</p>\r\n<p><strong>Goals: </strong></p>\r\n<p>It seems simple, but if you have a dream that you cant achieve without the help of a lot of people, youll need leadership skills to get them behind you. Having a mission for your team, organization, or yourself is one of the best reasons there is for wanting to be a leader.</p>\r\n<p><strong>People:</strong></p>\r\n<p>The best leaders put most of their time and energy into helping other people be more successful by making connections, giving feedback, and providing the resources they need. Love helping people grow? Leadership is a good fit for you.</p>\r\n<p><strong>Responsibility:</strong></p>\r\n<p>If youve started a company or landed in a management position, then youre already in a role where leadership skills are needed for you and your organization to succeed. You have the responsibility of being a leader, and you know you want to do it better. Thats a great place to start.</p>\r\n<p><strong>Ask yourself:</strong></p>\r\n<p>Why do you want to be a leader? The answer may be more complicated than your initial thought, but the important thing is to have thought long and hard about it.</p>\r\n<p>&nbsp;</p>\r\n					</div>', 'Jamie Younghee Sheen', 1, NULL, NULL, 'why-be-a-leader-to-begin-with', '2018-09-07 02:19:29', '2018-09-07 02:19:29', 'show', '2018-09-07 07:49:29', '{}', 'public/images/872bd3933c5be671e0cfce8f1fec7911.jpg'),
(11, 'Do You Have The Right Character for Leadership?', '<div class=\"entry-content\">\r\n					<p><span style=\"font-weight: 400;\">Whether you are an upcoming professional looking to make the jump into management, a team leader looking to step into a more senior position, or already leading your company and searching for the right people to install into those important positions just below you, it is important to be aware of what a good potential leader looks like. </span></p>\r\n<p>&nbsp;</p>\r\n<p><b>Asking the Right Questions</b></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight: 400;\">Assessing would-be leaders in any organization could be determined by asking three specific questions. Ask yourself, in whatever level you currently occupy, how you relate:</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight: 400;\">Do you have the competency to be a leader? Youll need knowledge of your field, an understanding of key concepts, facts and relationships to do your job effectively. &nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight: 400;\">Think about your commitment levels. You may aspire to be a leader, but are you really prepared to take on the hard work that it entails? Can you engage with others in fulfilling the organizational mission, create a vision and deliver on the goals?</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight: 400;\">Along with the competency and the commitment, do you have the character to be a good leader as well as strive to be an even better one? Character in this instance meaning do you have the right values, traits and virtues that the people who matter  shareholders, employees, customers, suppliers, the broader society, etc.  will use to determine your adequacy?</span></p>\r\n<p>&nbsp;</p>\r\n<p><b>Character Is Key</b></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight: 400;\">Perhaps its worth focusing on the concept of character with regards to leadership, as it can be tricky to define, measure, assess, and develop. There has been a lot written already about leadership style, as well as the competencies needed for the job, yet, character doesnt get the attention it deserves. For such an important element of leadership it is important it does not get ignored. Character is associated with, fundamentally, how we engage with the world around us, what we notice, reinforce what we value and what we choose to act on. More than ever, character, and strength of character are both essential in the current corporate world. Just ask anyone who supports a more honest and transparent culture in the wake of the 08/09 financial crisis. </span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight: 400;\">When it comes to leadership, competencies determine what a person can do, and commitment determines what they want to do, and character determines what they will do. Character then is essential for effective decision-making. While mistakes are made due to a lack of competencies, often the root cause of such mistakes can be traced back to failing of character. For instance, not realizing, or admitting that you dont have the right competencies for a specific job or project is a failing in character. Not willing to listen to those with good ideas, or who can do a good job because of the fear that they will undermine your leadership is a problem rooted in character. Challenging decisions made by others which you feel are wrong also requires character.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight: 400;\">Character is not something you have or dont have. We all have character, but the key is developing our character to give us the best chance of leading in holistic way. It is not something that is developed overnight either. Its doing the small things correctly, not taking shortcuts, and facing up to tough decisions. No one is perfect when it comes to character, and development is a lifelong journey. For those of us who intend to lead, its a journey worth starting immediately.</span></p>\r\n<p>&nbsp;</p>\r\n<p><em>naisA Global is a 501(c)(3) non-profit educational organization dedicated to helping talented young Asian professionals unlock their potential and become great leaders.</em></p>\r\n					</div>', 'Jamie Younghee Sheen', 1, NULL, NULL, 'do-you-have-the-right-character-for-leadership', '2018-09-07 02:35:24', '2018-09-07 02:35:24', 'show', '2018-09-07 08:05:24', '{}', NULL);
