(1, 'Homepage', 'homepage', NULL, NULL, NULL, 1, '2018-09-04 23:55:21', '2018-09-07 02:20:14', 'nfa-homepage-template', '2018-09-05 05:25:00', '{\"nfa-our-charity-rating\":\"[nfa-block id=\\\"nfa-our-charity-rating\\\" title=\\\"Our Charity Rating\\\" desc=\\\"Platinum-level from GuideStar Demonstrating our commitment to transparency. Learn more by clicking here.\\\" link=\\\"http:\\/\\/127.0.0.1:8000\\/donate\\/\\\"]\",\"nfa-join-nfa\":\"<div class=\\\"et_pb_module et_pb_text et_pb_text_0 et_pb_bg_layout_light  et_pb_text_align_left\\\">\\r\\n                                                    <div class=\\\"et_pb_text_inner\\\">\\r\\n                                                        <h4><img class=\\\"alignnone size-medium wp-image-18964\\\" src=\\\"https:\\/\\/naisaglobal.org\\/staging\\/wp-content\\/uploads\\/2018\\/08\\/NFA-img-155x74.jpg\\\" alt=\\\"\\\" width=\\\"155\\\" height=\\\"74\\\" srcset=\\\"https:\\/\\/naisaglobal.org\\/staging\\/wp-content\\/uploads\\/2018\\/08\\/NFA-img-155x74.jpg 155w, https:\\/\\/naisaglobal.org\\/staging\\/wp-content\\/uploads\\/2018\\/08\\/NFA-img-80x38.jpg 80w, https:\\/\\/naisaglobal.org\\/staging\\/wp-content\\/uploads\\/2018\\/08\\/NFA-img-260x123.jpg 260w, https:\\/\\/naisaglobal.org\\/staging\\/wp-content\\/uploads\\/2018\\/08\\/NFA-img-160x76.jpg 160w, https:\\/\\/naisaglobal.org\\/staging\\/wp-content\\/uploads\\/2018\\/08\\/NFA-img.jpg 352w\\\" sizes=\\\"(max-width: 155px) 100vw, 155px\\\"> Introducing naisA Flash Advice.<\\/h4>\\r\\n                                                        <p>We connect young aspiring professionals with industry leaders for career coaching focused on leadership development.<\\/p>\\r\\n                                                    <\\/div>\\r\\n                                                <\\/div>\\r\\n                                                <!-- .et_pb_text -->\\r\\n                                                <div class=\\\"et_pb_module et_pb_text et_pb_text_1 et_pb_bg_layout_light  et_pb_text_align_left\\\">\\r\\n                                                    <div class=\\\"et_pb_text_inner\\\">\\r\\n                                                        <h4>How it works:<\\/h4>\\r\\n                                                        <ul>\\r\\n                                                            <li>Apply with resume and\\/or LinkedIn<\\/li>\\r\\n                                                            <li>Choose the best mentor from our extensive list of highly-qualified experts<\\/li>\\r\\n                                                            <li>Book the time that works best for you<\\/li>\\r\\n                                                            <li>Receive career coaching on a mutually agreed communication platform ( Skype, WeChat, Kakao Talk, Telephone, etc.)<\\/li>\\r\\n                                                        <\\/ul>\\r\\n                                                    <\\/div>\\r\\n                                                <\\/div>\\r\\n                                                <!-- .et_pb_text -->\",\"nfa-our-work\":\"[nfa-block id=\\\"nfa-our-mission\\\" title=\\\"Our Mission\\\" desc=\\\"Founded in 2013, we are dedicated to helping young talented Asian Professionals unlock their potential and become great leaders.\\\"]\\r\\n<div class=\\\"et_pb_column et_pb_column_1_4 et_pb_column_25 et_pb_css_mix_blend_mode_passthrough\\\">\\r\\n\\t<div class=\\\"et_pb_with_border et_pb_module et_pb_blurb et_pb_blurb_13 et_pb_bg_layout_light et_pb_text_align_center et_pb_blurb_position_top\\\">\\r\\n\\t\\t<div class=\\\"et_pb_blurb_content\\\">\\r\\n\\t\\t\\t<div class=\\\"et_pb_blurb_container\\\">\\r\\n\\t\\t\\t\\t<h2 class=\\\"et_pb_module_header\\\">Our Impact<\\/h2>\\r\\n\\t\\t\\t\\t<div class=\\\"et_pb_blurb_description\\\">\\r\\n\\t\\t\\t\\t\\t<p style=\\\"text-align: center;\\\"><span style=\\\"color: #0688f9;\\\">2,000+<\\/span><br>\\r\\n\\t\\t\\t\\t\\t\\tYoung Emerging Leaders<br>\\r\\n\\t\\t\\t\\t\\t\\t<span style=\\\"color: #0688f9;\\\">500+<\\/span><br>\\r\\n\\t\\t\\t\\t\\t\\tIndustry Experts<br>\\r\\n\\t\\t\\t\\t\\t\\t<span style=\\\"color: #0688f9;\\\">3,900+<\\/span><br>\\r\\n\\t\\t\\t\\t\\t\\tMentoring Sessions<br>\\r\\n\\t\\t\\t\\t\\t\\t<span style=\\\"color: #0688f9;\\\">11,000+<\\/span><br>\\r\\n\\t\\t\\t\\t\\t\\tFacebook Followers\\r\\n\\t\\t\\t\\t\\t<\\/p>\\r\\n\\t\\t\\t\\t<\\/div>\\r\\n\\t\\t\\t\\t<!-- .et_pb_blurb_description -->\\r\\n\\t\\t\\t<\\/div>\\r\\n\\t\\t<\\/div>\\r\\n\\t\\t<!-- .et_pb_blurb_content -->\\r\\n\\t<\\/div>\\r\\n\\t<!-- .et_pb_blurb -->\\r\\n<\\/div>\",\"\":null,\"nfa-features\":\"[nfa-block id=\\\"nfa-features\\\" title=\\\"naisA Flash Advice\\\" desc=\\\"Connecting emerging Asian leaders with industry experts via our online platform & offline group mentoring sessions\\\" link=\\\"#\\\"]<span><\\/span>[nfa-block id=\\\"nfa-features\\\" title=\\\"naisA Talks\\\" desc=\\\"Presenting inspiring leadership speaking series that address leadership development topics\\\" link=\\\"#\\\"]\\r\\n\\r\\n[nfa-block id=\\\"nfa-features\\\" title=\\\"naisA Flash Webinars\\\" desc=\\\"Providing a 20 minute insightful presentation with Q&A on career and leadership development\\\" link=\\\"#\\\"]\\r\\n\\r\\n[nfa-block id=\\\"nfa-features\\\" title=\\\"NextGen Awards Gala\\\" desc=\\\"Celebrating Asian American Achievements and bringing together prominent Asian Leaders and the next generation\\\" link=\\\"#\\\"]\",\"nfa-sponser-img\":\"\"}', NULL),
