(12, 'NFA Testimonials Founder', 'nfa-testimonials-founder', '<div class=\"et_pb_slide et_pb_slide_10 et_pb_bg_layout_light et_pb_media_alignment_center\">\r\n                                                            <div class=\"et_pb_container clearfix\">\r\n                                                                <div class=\"et_pb_slider_container_inner\">\r\n                                                                    <div class=\"et_pb_slide_description\">\r\n                                                                        <div class=\"et_pb_slide_content\">\r\n                                                                            <div id=\"testimonial_rotator_wrap_18157\" class=\"testimonial_rotator_wrap with-prevnext \">\r\n                                                                                <div id=\"testimonial_rotator_18157\" class=\"testimonial_rotator hreview-aggregate cycletwo-slideshow format-rotator template-default testimonial-rotator-single \" data-cycletwo-timeout=\"6000\" data-cycletwo-speed=\"1000\" data-cycletwo-pause-on-hover=\"true\" data-cycletwo-center-horz=\"true\" data-cycletwo-center-vert=\"true\" data-cycletwo-swipe=\"true\" data-cycletwo-fx=\"fade\" data-cycletwo-auto-height=\"calc\" data-cycletwo-next=\"#testimonial_rotator_wrap_18157 .testimonial_rotator_next\" data-cycletwo-prev=\"#testimonial_rotator_wrap_18157 .testimonial_rotator_prev\" data-cycletwo-slides=\"> div.slide\" data-cycletwo-log=\"false\">\r\n                                                                                    <div class=\"testimonial_rotator testimonial_rotator_single template-default hreview itemreviewed item has-image cf-tr\">\r\n                                                                                        <div class=\"testimonial_rotator_img img\"><img width=\"180\" height=\"180\" src=\"https://naisaglobal.org/staging/wp-content/uploads/2018/08/Elizabeth-Cho-Fertikh-180x180.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"\" srcset=\"https://naisaglobal.org/staging/wp-content/uploads/2018/08/Elizabeth-Cho-Fertikh-180x180.jpg 180w, https://naisaglobal.org/staging/wp-content/uploads/2018/08/Elizabeth-Cho-Fertikh-60x60.jpg 60w, https://naisaglobal.org/staging/wp-content/uploads/2018/08/Elizabeth-Cho-Fertikh-118x118.jpg 118w, https://naisaglobal.org/staging/wp-content/uploads/2018/08/Elizabeth-Cho-Fertikh-160x160.jpg 160w, https://naisaglobal.org/staging/wp-content/uploads/2018/08/Elizabeth-Cho-Fertikh-300x300.jpg 300w, https://naisaglobal.org/staging/wp-content/uploads/2018/08/Elizabeth-Cho-Fertikh-100x100.jpg 100w, https://naisaglobal.org/staging/wp-content/uploads/2018/08/Elizabeth-Cho-Fertikh.jpg 450w\" sizes=\"(max-width: 180px) 100vw, 180px\"></div>\r\n                                                                                        <div class=\"text testimonial_rotator_description\">\r\n                                                                                            <h2 class=\"testimonial_rotator_slide_title\">Mentor Elizabeth Cho-Fertikh</h2>\r\n                                                                                            <div class=\"testimonial_rotator_quote\">\r\n                                                                                                It was a pleasant surprise to see as many non-Asian proteges and mentors as Asian ones at the Protege Fair. This tells me that there\'s a broader community supportive of or somehow interested in the mission of naisA Global, which is terrific. It\'s through diverse perspectives and contributions that any organization\'s mission can become stronger, and a real tribute to naisA opening its doors to as many.\r\n                                                                                            </div>\r\n                                                                                            <div class=\"testimonial_rotator_author_info cf-tr\">\r\n                                                                                                <p>Founder</p>\r\n                                                                                                <p>ECF Biosolutions</p>\r\n                                                                                            </div>\r\n                                                                                        </div>\r\n                                                                                        <div class=\"testimonial_rotator_microdata\">\r\n                                                                                            <div class=\"dtreviewed\"> 2018-08-09T22:39:49+00:00</div>\r\n                                                                                            <div class=\"reviewer\">\r\n                                                                                                <div class=\"fn\">\r\n                                                                                                    <p>Founder</p>\r\n                                                                                                    <p>ECF Biosolutions</p>\r\n                                                                                                </div>\r\n                                                                                                <img width=\"60\" height=\"60\" src=\"https://naisaglobal.org/staging/wp-content/uploads/2018/08/Elizabeth-Cho-Fertikh-60x60.jpg\" class=\"photo wp-post-image\" alt=\"\" srcset=\"https://naisaglobal.org/staging/wp-content/uploads/2018/08/Elizabeth-Cho-Fertikh-60x60.jpg 60w, https://naisaglobal.org/staging/wp-content/uploads/2018/08/Elizabeth-Cho-Fertikh-118x118.jpg 118w, https://naisaglobal.org/staging/wp-content/uploads/2018/08/Elizabeth-Cho-Fertikh-180x180.jpg 180w, https://naisaglobal.org/staging/wp-content/uploads/2018/08/Elizabeth-Cho-Fertikh-160x160.jpg 160w, https://naisaglobal.org/staging/wp-content/uploads/2018/08/Elizabeth-Cho-Fertikh-300x300.jpg 300w, https://naisaglobal.org/staging/wp-content/uploads/2018/08/Elizabeth-Cho-Fertikh-100x100.jpg 100w, https://naisaglobal.org/staging/wp-content/uploads/2018/08/Elizabeth-Cho-Fertikh.jpg 450w\" sizes=\"(max-width: 60px) 100vw, 60px\">\r\n                                                                                            </div>\r\n                                                                                            <div class=\"summary\"> </div>\r\n                                                                                            <div class=\"permalink\"> https://naisaglobal.org/staging/testimonials/mentor-elizabeth-cho-fertikh/</div>\r\n                                                                                        </div>\r\n                                                                                        <!-- .testimonial_rotator_microdata -->\r\n                                                                                    </div>\r\n                                                                                </div>\r\n                                                                                <!-- #testimonial_rotator_18157 -->\r\n                                                                            </div>\r\n                                                                            <!-- .testimonial_rotator_wrap -->\r\n                                                                        </div>\r\n                                                                    </div>\r\n                                                                    <!-- .et_pb_slide_description -->\r\n                                                                </div>\r\n                                                            </div>\r\n                                                            <!-- .et_pb_container -->\r\n                       