(15, 'NFA Testimonials President', 'nfa-testimonials-president', '<div class=\"et_pb_slide et_pb_slide_6 et_pb_bg_layout_light et_pb_media_alignment_center et-pb-active-slide\">\r\n                                                            <div class=\"et_pb_container clearfix\">\r\n                                                                <div class=\"et_pb_slider_container_inner\">\r\n                                                                    <div class=\"et_pb_slide_description\">\r\n                                                                        <div class=\"et_pb_slide_content\">\r\n                                                                            <div id=\"testimonial_rotator_wrap_18157\" class=\"testimonial_rotator_wrap with-prevnext \">\r\n                                                                                <div id=\"testimonial_rotator_18157\" class=\"testimonial_rotator hreview-aggregate cycletwo-slideshow format-rotator template-default testimonial-rotator-single \" data-cycletwo-timeout=\"6000\" data-cycletwo-speed=\"1000\" data-cycletwo-pause-on-hover=\"true\"  data-cycletwo-center-horz=\"true\" data-cycletwo-center-vert=\"true\"  data-cycletwo-swipe=\"true\" data-cycletwo-fx=\"fade\" data-cycletwo-auto-height=\"calc\"  data-cycletwo-next=\"#testimonial_rotator_wrap_18157 .testimonial_rotator_next\" data-cycletwo-prev=\"#testimonial_rotator_wrap_18157 .testimonial_rotator_prev\" data-cycletwo-slides=\"> div.slide\" data-cycletwo-log=\"false\" >\r\n                                                                                    <div class=\"testimonial_rotator testimonial_rotator_single template-default hreview itemreviewed item has-image cf-tr\">\r\n                                                                                        <div class=\"testimonial_rotator_img img\"><img width=\"180\" height=\"180\" src=\"https://naisaglobal.org/staging/wp-content/uploads/2018/08/cindy-shao-180x180.jpg\" class=